import React, { useState } from 'react'
import styled from 'styled-components/native';

import { MaterialCommunityIcons } from '@expo/vector-icons';
import { FontAwesome5 } from '@expo/vector-icons';
import { FontAwesome } from '@expo/vector-icons';

const Footer = () => {

    return (
        <FooterContainer>
            <IconDiary>
                <MaterialCommunityIcons name="fountain-pen-tip" size={24} color="#BD614E" />
                <Text>Dagbok</Text>
            </IconDiary>
            <IconExplore>
            <FontAwesome5 name="readme" size={24} color="#5A673E" />
            <Text>Utforska</Text>

            </IconExplore>
            <IconStatistics>
            <FontAwesome name="bar-chart" size={24} color="#E4C9D6" />
            </IconStatistics>
            <IconProfile>

            </IconProfile>
        </FooterContainer>
    )

}

const FooterContainer = styled.View`
margin-top: 0px;
height: 130px;
border: solid pink 2px;
width: 100%;
flex-direction:row;
justify-content: space-evenly;
`
const Text = styled.Text`

`

const IconDiary = styled.View`
border: solid black 1px;
`
const IconExplore = styled.View`
border: solid black 1px;

`
const IconStatistics = styled.View`
border: solid black 1px;

`

const IconProfile = styled.View`
border: solid black 1px;

`

export default Footer;
